import React from 'react';

const baoCao = () => {
    return (
        <div className="page-admin container">
            <div>
                <h3>Báo Cáo</h3>
                <p>Xây dựng giao diện</p>
                <p>Dùng json-server làm db api</p>
                <p>Tạo dữ liệu json gồm sản phẩm và loại sản phẩm</p>
                <p>Sử dụng router để nhúng các chức năng vào layout</p>
                <p>Hiển thị sản phẩm theo loại</p>
                <p>Chi tiết sản phẩm</p>
                <p>Giỏ hàng chọn sản phẩm cập nhật, xoá, tổng tiền</p>
                <p>Đăng nhập với google</p>
            </div>
        </div>
    );
}

export default baoCao;
